import Expcard from "./Expcard";
import Expcarddata from "./Expcarddata";
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
function Experience() {
    return (<>

        <div className="container-fluid Experience mt-5 ">
            <div className="row d-flex justify-conten-center ">

                <div className="col-sm-10 mx-auto">

                    <div className="">
                        <h1 className="heading text-center">Experience</h1>
                    </div>

                </div>

                <div className="col-sm-10 mx-auto ">

                    <Swiper
                        spaceBetween={50}
                        slidesPerView={2}
                        onSlideChange={() => console.log('slide change')}
                        onSwiper={(swiper) => console.log(swiper)}
                    >
                    <div className="row d-flex justify-content-between mgy-3 p-5 ">
                        <SwiperSlide>
                                {
                                    Expcarddata.map((val, ind) => {
                                        return <Expcard date={val.date} title={val.title} para={val.para} />
                                    })}
                        </SwiperSlide>
                        </div>
                    </Swiper>
                </div>
            </div>
        </div>
    </>);
}

export default Experience;
